# Problema de las n reinas utilizando backtracking
# Para interactuar con el juego basta con fijar el valor de N y
# crear un tablero de N x N

N = 8

def imprimir_solucion(tablero):
    # Funcion que imprime el tablero resultante

    for i in range(N):
        for j in range(N):
            if tablero[i][j] == 1:
                print("R",end=" ")
            else:
                print("x",end=" ")
        print()


def jugada_segura(tablero, row, col):
    # Funcion que revisa si es posible colocar la nueva reina en determinada posicion

    for i in range(col):
        if tablero[row][i] == 1:
            return False

    for i, j in zip(range(row, -1, -1),
                    range(col, -1, -1)):
        if tablero[i][j] == 1:
            return False

    for i, j in zip(range(row, N, 1),
                    range(col, -1, -1)):
        if tablero[i][j] == 1:
            return False

    return True


def solucion(tablero, col):
    # Funcion recursiva que revisa si una nueva reina puede ser colocada en la siguiente posicion
    if col >= N:
        return True

    for i in range(N):
        if jugada_segura(tablero, i, col):
            tablero[i][col] = 1
            if solucion(tablero, col + 1):
                return True
            tablero[i][col] = 0

    return False


